  return (
    <Router>
      <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
        <Link to="/" className='nav-link'>Gasolina 95</Link>
        <Link to="/gasolina98" className='nav-link'>Gasolina 98</Link>
        <Link to="/gasoleo" className='nav-link'>Gas√≥leo</Link>
      </nav>
      <Routes>
        <Route exact path='/' element={
          <div>
            <Gasolina95/>
            <Fecha/>
          </div>
        }/>
        <Route path='/gasoleo' element={<Gasoleo/>}/>
        <Route exact path='/gasolina98' element={<Gasolina98/>}/>
      </Routes>
    </Router>

  );
}

export default App;
